"use strict";function responseAdd(t,a){if(200==a.code){var n='<tr data-id="'+a.annotation.id+'"><td>'+t.find("[name=title]").val()+"</td><td>"+a.annotation.name+"</td><td>"+a.annotation.multi+"</td></tr>";$("table.table tr:last").after(n),$("#txt-annotation-label").val("")}}function responseRemove(t,a){200==a.code&&$('tr[data-id="'+$(".txt-selected").val()+'"]').remove()}$(function(){$("table.table").on("click","tr",function(){$("button.item-selected").parent("form").attr("action","/annotations/"+$(this).attr("data-id"))})});